import React from "react";
import { MessageInput } from "./FormStyles";

interface Props {
  labelName: string;
  rows: number;
  // messageValue: string;
  messageChange: (event: React.ChangeEvent<HTMLTextAreaElement>)=>void;
};

const FormMessage: React.FC<Props> = (props) => {
  return(
    <MessageInput placeholder={props.labelName} rows={props.rows}  onChange={props.messageChange}/>
  )
};

export default FormMessage;
